import * as style from "../../css/light/focusedList";
import FocusedTitle from "./focusedTitle"
import FocusedHistory from "./focusedHistory";
import FocusedData from "./focusedData"

//Extends Main
export default function Focused({focused, setFocused, locationHierarchy, rawData}) {
  let focusedItem = {}

  if (!focused[0]) return <div></div>

  for (let i in rawData[focused[1]]) {
    if (focused[0] === rawData[focused[1]][i]['profile']) {
      focusedItem = rawData[focused[1]][i]
      break
    }
  }

  return (
    <div style={style.focusedContainer}>
      <FocusedTitle setFocused={setFocused} focusedItem={focusedItem} locationHierarchy={locationHierarchy}/>
      <FocusedData focusedItem={focusedItem}/>
      <FocusedHistory focusedItem={focusedItem}/>
    </div>
  )
}
